--
-- Table structure for table `organization`
--

DROP TABLE IF EXISTS `organization`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `organization` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(512) NOT NULL COMMENT '组织名称',
  `code` varchar(512) DEFAULT NULL COMMENT '组织机构代码',
  `version` bigint(20) unsigned NOT NULL COMMENT '版本',
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '审核状态， 0：未审核 1:通过审核',
  `level` varchar(512) DEFAULT NULL COMMENT 'String 用来记录医院的等级 暂时的等级是一级、二级、三级；甲等乙等丙等（其中三级独有特等）',
  `area_id` bigint(20) unsigned DEFAULT NULL COMMENT '外键 关联区域规划表中的区级 用来存储医院的区域信息',
  `img_url` varchar(512) DEFAULT NULL COMMENT '医院图片的url',
  `address` varchar(512) DEFAULT NULL COMMENT '地址',
  `lat` decimal(10,8) DEFAULT NULL COMMENT '经度',
  `lon` decimal(11,8) DEFAULT NULL COMMENT '纬度',
  `expired_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '过期时间',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `organization_area` (`area_id`),
  CONSTRAINT `organization_area` FOREIGN KEY (`area_id`) REFERENCES `area` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=100042 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

